import React from 'react';
import '../allcomponentindex.css'

class Histogram extends React.Component{
    state={

    }


    render(){
        const Line=({left}) =>{
                return(
                    <div className="line" style={{left:`${left}%`}} />
                )
        }
        const BarTextContent=()=>{
            return(
                <div className="bartectcontent">
                    hi there
                </div>
            )
        }
        const renderLines=()=>{
            return Array(20).fill(null).map((el,i)=>(
                <Line left={i*10} key={i} />
            ))
        }
        return(

                <div className="graph">
                   <BarTextContent />
                    <div className="barLinesContainer">
                    {renderLines()}
                    </div>
                </div>


        )
    }

}

export default Histogram;
